  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Rydell
  National Wildlife Refuge summarizes Refuge activities during the 1995 calendar year.
  The report begins with a summary of the yearu2019s highlights and climatic conditions.
  Land acquisition is also covered. The report includes a planning section which discusses
  the master plan, the management plan, public participation, research, and investigations.
  \ Refuge administration is outlined; information about personnel, volunteer programs,
  funding, and safety is given. Habitat management is also covered. Subjects include
  wetlands, croplands, grasslands, haying, and pest control. The wildlife section
  of the report discusses wildlife diversity, endangered species, threatened species,
  waterfowl, marsh birds, waterbirds, shorebirds, raptors, game mammals, fisheries
  resources, wildlife propagation and stocking, animal control, marking, and banding.
  The public uses of the Refuge described in this report include hunting, fishing,
  wildlife observation, and law enforcement. The equipment and facilities section
  of the report provides information about new construction, rehabilitation, major
  maintenance, equipment utilization and replacement, communication systems, computer
  systems, and energy conservation. Cooperative programs and items of interest are
  provided at the end.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
